import {BrowserRouter, Link, Route, Routes} from 'react-router-dom';
import './App.css';

import Page1 from './components/page1';
import {Page2} from './components/page2';

export const App = () => {
    return (
        <BrowserRouter>
            <div className="App">
                <Routes>
                    <Route path="/" element={<Page1/>}/>
                    <Route path="/about" element={<Page2/>}/>
                </Routes>
                {/* <Footer /> */}
            </div>
        </BrowserRouter>
    );
};
